      SELECT ALL - col2 + 17 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + ( 3 ) + + - col2 IN ( col1 * - col1 / 37 + + col2 );
  - name: tab1

outputs:
